import React from 'react';

const Grid = ({
	container,
	item,
	direction,
	wrap,
	justifyContent,
	alignItems,
	size,
	spacing,
}) => {
	const GridContainer = styled.div`
        display: flex,
        flex-flow: ${direction} ${wrap},
        justifyContent: ${justifyContent},
        align-items: ${alignItems},
        gap: ${4 * spacing || 0}px,
    `;

	const GridItem = styled.div`
		width: ${size / 16}%;
	`;

	return <React.Fragment />;
};

export default Container;
